import React from 'react'
import * as S from './index.style'
import logo from '../../assets/logo.png'

const Header = () => {
  return (
    <div>
      <S.Logo onClick={()=> navigate('/')} src={logo}></S.Logo>
    </div>
  )
}

export default Header
